import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const Signup = () => {
  const [formData, setFormData] = useState({
    cnic: "",
    name: "",
    email: "",
    phone: "",
    province: "",
    city: "",
    constituency: "",
    dateOfBirth: "",
    password: "",
  });
  const navigate = useNavigate();

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSignup = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5000/voter/signup", {
        ...formData,
        address: {
          province: formData.province,
          city: formData.city,
          constituency: formData.constituency,
        },
      });
      alert("Signup successful!");
      console.log(response.data);
      navigate("/"); // Redirect to login page
    } catch (error) {
      alert("Signup failed. Please check your input.");
      console.error(error);
    }
  };

  // Styles
  const containerStyle = {
    display: "flex",
    minHeight: "100vh",
    background: "linear-gradient(135deg, #1a2b2d, #0f1d1f)",
    padding: "20px",
    color: "white",
  };

  const leftSectionStyle = {
    flex: 1,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    fontSize: "1.5rem",
    fontWeight: "bold",
  };

  const formSectionStyle = {
    flex: 1,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  };

  const formStyle = {
    background: "white",
    padding: "2.5rem",
    borderRadius: "10px",
    boxShadow: "0 4px 10px rgba(0, 0, 0, 0.2)",
    width: "100%",
    maxWidth: "400px",
  };

  const rowStyle = {
    display: "flex",
    justifyContent: "space-between",
    gap: "10px",
    marginBottom: "1.2rem",
  };

  const inputStyle = {
    flex: 1,
    padding: "0.8rem",
    border: "1px solid #ddd",
    borderRadius: "5px",
    fontSize: "16px",
  };

  const buttonStyle = {
    width: "100%",
    padding: "0.8rem",
    border: "none",
    borderRadius: "5px",
    background: "#1a2b2d",
    color: "white",
    fontSize: "1rem",
    fontWeight: "500",
    cursor: "pointer",
  };

  return (
    <div style={containerStyle}>
      <div style={leftSectionStyle}>
        <h1>Welcome to Signup</h1>
      </div>
      <div style={formSectionStyle}>
        <form style={formStyle} onSubmit={handleSignup}>
          <h2 style={{ textAlign: "center", marginBottom: "1.5rem" }}>Signup</h2>

          <div style={rowStyle}>
            <input
              type="text"
              name="cnic"
              placeholder="CNIC"
              value={formData.cnic}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
            <input
              type="text"
              name="name"
              placeholder="Name"
              value={formData.name}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
          </div>

          <div style={rowStyle}>
            <input
              type="email"
              name="email"
              placeholder="Email"
              value={formData.email}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
            <input
              type="text"
              name="phone"
              placeholder="Phone"
              value={formData.phone}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
          </div>

          <div style={rowStyle}>
            <input
              type="text"
              name="province"
              placeholder="Province"
              value={formData.province}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
            <input
              type="text"
              name="city"
              placeholder="City"
              value={formData.city}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
          </div>

          <div style={rowStyle}>
            <input
              type="text"
              name="constituency"
              placeholder="Constituency"
              value={formData.constituency}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
            <input
              type="date"
              name="dateOfBirth"
              placeholder="Date of Birth"
              value={formData.dateOfBirth}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
          </div>

          <div style={rowStyle}>
            <input
              type="password"
              name="password"
              placeholder="Password"
              value={formData.password}
              onChange={handleInputChange}
              style={inputStyle}
              required
            />
          </div>

          <button type="submit" style={buttonStyle}>
            Signup Now
          </button>
        </form>
      </div>
    </div>
  );
};

export default Signup;
